import * as React from 'react';
import { AppBar, Toolbar, Drawer, Box, List, ListItem, ListItemText, useTheme, useMediaQuery, Button } from '@mui/material';

const Navbar = () => {
  const [drawerOpen, setDrawerOpen] = React.useState(false);
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('sm'));

  const handleDrawerToggle = () => {
    setDrawerOpen(!drawerOpen);
  };

  const drawer = (
    <Box onClick={handleDrawerToggle} sx={{ textAlign: 'center', width: 250 }}>
      <List>
        <ListItem button>
          <ListItemText primary="Home" sx={{ textAlign: 'center', color: 'purple' }} />
        </ListItem>
        <ListItem button>
          <ListItemText primary="About" sx={{ textAlign: 'center', color: 'purple' }} />
        </ListItem>
        <ListItem button>
          <ListItemText primary="Services" sx={{ textAlign: 'center', color: 'purple' }} />
        </ListItem>
        <ListItem button>
          <ListItemText primary="Contact" sx={{ textAlign: 'center', color: 'purple' }} />
        </ListItem>
      </List>
    </Box>
  );

  return (
    <AppBar position="static" sx={{ background: 'transparent', boxShadow: 'none', justifyContent: 'center' }}>
      <Toolbar>
        <Box sx={{ flexGrow: 1, display: 'flex', justifyContent: 'center' }}>
          <img src="logo.png" alt="Logo" style={{ height: '50px' }} />
          {!isMobile && (
            <Box sx={{ display: 'flex', justifyContent: 'center' }}>
              <Button color="inherit" sx={{ color: 'purple' }}>Home</Button>
              <Button color="inherit" sx={{ color: 'purple' }}>About</Button>
              <Button color="inherit" sx={{ color: 'purple' }}>Services</Button>
              <Button color="inherit" sx={{ color: 'purple' }}>Contact</Button>
            </Box>
          )}
        </Box>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
